import { Layout } from "../components/Layout";
import Link from "next/link";

export function BlogLink({ title, children }) {
  return (
    <li>
      <Link href={`/blogpost?title=${title}`}>
        <a>{children}</a>
      </Link>
    </li>
  );
}

function Blog() {
  return (
    <Layout>
      <h2>This is the blog page</h2>
      <ul>
        <BlogLink title="blog1">First Blog</BlogLink>
        <BlogLink title="blog2">Second Blog</BlogLink>
        <BlogLink title="blog3">Third Blog</BlogLink>
      </ul>
    </Layout>
  );
}

export default Blog;
